My work is in two local shows and both receptions were last night. It was a fun but busy night hopping around! It was inspiring seeing all the other art!!!! Here’s my piece, “The Best Advice” in the “Being Human” show at @centersforartsbonita. Let me tell you, that place has the sweetest vibe and they put on amazing shows. If you can become a member you’ll love it. Even non-members can come to the shows. You will love it. 

The other show is at Covenant Church, Naples. The theme is “Hope Speaks Louder than Despair” and it’s lovely too. There’s an exciting variety of media. Very beautiful! 

@covenantnaples #hopewins #theanchorofmysoul⚓️ #bestadvice #beinghuman #artshow #naplesartist #naplesartshow #naplesartists

From reference pic to completion — here you go! Not only do I love this weathered wood gate with the peek-a-boo iron insert, but I also like the contrast of something old with the brilliant colors of new life. Something about it tells me everything’s gonna be okay. There will be new beginnings all around us. Happy Spring!

